import styled from 'styled-components'

const StyledCard = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: center;
    background-color: white;
    width: 90%;
    margin: 20px auto;
    padding: 20px 20px 5px 20px;
    text-align: center;
    border-radius: 8px;
    cursor: pointer;
`

export default StyledCard
